			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# Sets the target folders and the final framework product.\n# 如果工程名称和Framework的Target名称不一样的话，要自定义FMKNAME\n# 例如: FMK_NAME = \"MyFramework\"\nFMK_NAME=${PROJECT_NAME}\n\n\n# Install dir will be the final output to the framework.\n# The following line create it in the root folder of the current project.\n\nAIP_DIR=${SRCROOT}/..\nINSTALL_DIR=${AIP_DIR}/Products-Release/lib/${FMK_NAME}.framework\necho \"WORKING dir:$(pwd)\"\n# Working dir will be deleted after the framework creation.\nWRK_DIR=build\nDEVICE_DIR=${WRK_DIR}/Release-iphoneos/${FMK_NAME}.framework\nSIMULATOR_DIR=${WRK_DIR}/Release-iphonesimulator/${FMK_NAME}.framework\n\n# Cleaning the oldest.\nif [ -d \"${INSTALL_DIR}\" ]; then\n    rm -rf \"${INSTALL_DIR}\"\nfi\n\nxcodebuild -configuration \"Release\" OTHER_CFLAGS=\"-fembed-bitcode\"  ENABLE_BITCODE=YES -target \"${FMK_NAME}\" -sdk iphoneos BITCODE_GENERATION_MODE=bitcode clean build\nxcodebuild -configuration \"Release\" ENABLE_BITCODE=YES OTHER_CFLAGS=\"-fembed-bitcode\" -target \"${FMK_NAME}\" -sdk iphonesimulator build\n\ncp -R \"${DEVICE_DIR}\" \"${INSTALL_DIR}\"  # 这里是拷贝所有文件，后面.a文件会被替代\n# 整合 到AipOcrSdk 目录，覆盖原有的 bin\nlipo -create \"${DEVICE_DIR}/${FMK_NAME}\" \"${SIMULATOR_DIR}/${FMK_NAME}\" -output \"${INSTALL_DIR}/${FMK_NAME}\"\n\n# 复制到上级lib目录\ncp -R \"${INSTALL_DIR}\" \"${AIP_DIR}/lib/\"\nrm -r \"${WRK_DIR}\"\n\nopen \"${INSTALL_DIR}\"\n\n\n";
